// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.8.0;

contract messageStorage {
    mapping(address => message) public messagesList;
	struct message
    {
		bytes32 senderId;
		bytes32 receiverId;
		bytes32 senderRole;
		bytes32 receiverRole;
		bytes32 msgType;
		address messageId;
		bytes32 propertyX;
		bytes32 propertyY;
		bytes32 listPrice;
    }
	
	 constructor() public {
		bytes32 senderId = "FHFHF";
		bytes32 receiverId = "sjsjsjs";
		bytes32 senderRole = "snjsjsjss";
		bytes32 receiverRole = "sksksksks";
		bytes32 msgType = "Cfp";
		address  messageId = 0xE0f5206BBD039e7b0592d8918820024e2a7437b9;
		bytes32 propertyX = "dkkdkd";
		bytes32 propertyY = "smssks";
		bytes32 listPrice = "skssk";
		
		message memory  mg;
		mg.senderId = senderId;
		mg.receiverId = receiverId;
		mg.senderRole = senderRole;
		mg.receiverRole = receiverRole;
		mg.msgType = msgType;
		mg.messageId = messageId;
		mg.propertyX = propertyX;
		mg.propertyY = propertyY;
		mg.listPrice = listPrice;
		messagesList[messageId] = mg;
		emit newMessage(messageId);
		
		messagesList[messageId] = mg;
	}
	
	event newMessage(address messageID);

	function createNewMessage(bytes32 senderId,
								bytes32 receiverId,
								bytes32 senderRole,
								bytes32 receiverRole,
								bytes32 msgType,
								address messageId,
								bytes32 propertyX,
								bytes32 propertyY,
								bytes32 listPrice) public 
	{
		message memory  mg;
		mg.senderId = senderId;
		mg.receiverId = receiverId;
		mg.senderRole = senderRole;
		mg.receiverRole = receiverRole;
		mg.msgType = msgType;
		mg.messageId = messageId;
		mg.propertyX = propertyX;
		mg.propertyY = propertyY;
		mg.listPrice = listPrice;
		messagesList[messageId] = mg;
		emit newMessage(messageId);
	}
	
	function getMessage(address msgId) public  returns (bytes32 senderId,
								bytes32 receiverId,
								bytes32 senderRole,
								bytes32 receiverRole,
								bytes32 msgType,
								address messageId,
								bytes32 propertyX,
								bytes32 propertyY,
								bytes32 listPrice)
	{
		message memory  mg;
		mg = messagesList[msgId];
		senderId = mg.senderId ;
		receiverId = mg.receiverId;
		senderRole = mg.senderRole;
		receiverRole = mg.receiverRole;
		msgType = mg.msgType;
		messageId = mg.messageId;
		propertyX = mg.propertyX;
		propertyY = mg.propertyY;
		listPrice = mg.listPrice;
		
	}
	function deleteMessage(address msgId) public 
	{
		delete messagesList[msgId];
	}
}
